import React, { useState } from 'react';

export default function LoginPage({ onLogin }) {
  const [mode, setMode]       = useState('login');
  const [form, setForm]       = useState({ name:'', email:'', password:'' });
  const [loading, setLoading] = useState(false);
  const [error, setError]     = useState('');
  const [showPw, setShowPw]   = useState(false);

  const set = e => setForm({...form, [e.target.name]: e.target.value});

  const submit = async e => {
    e.preventDefault(); setError('');
    if (!form.email || !form.password) { setError('Please fill in all fields.'); return; }
    if (mode === 'signup' && !form.name) { setError('Please enter your name.'); return; }
    setLoading(true);
    await new Promise(r => setTimeout(r, 1100));
    setLoading(false);
    const user = { name: form.name || form.email.split('@')[0], email: form.email };
    localStorage.setItem('medi_user', JSON.stringify(user));
    onLogin(user);
  };

  const demoLogin = () => {
    const user = { name: 'Demo User', email: 'demo@mediexplain.ai' };
    localStorage.setItem('medi_user', JSON.stringify(user));
    onLogin(user);
  };

  return (
    <div style={s.root}>
      {/* Grid background */}
      <div style={s.grid}/>
      {/* Glow orbs */}
      <div style={{...s.orb, top:'8%', left:'12%', width:400, height:400, background:'radial-gradient(circle,rgba(14,165,233,0.13) 0%,transparent 70%)'}}/>
      <div style={{...s.orb, bottom:'5%', right:'8%', width:500, height:500, background:'radial-gradient(circle,rgba(45,212,191,0.09) 0%,transparent 70%)'}}/>

      <div style={s.wrap}>
        {/* ‚îÄ‚îÄ Left branding panel ‚îÄ‚îÄ */}
        <div style={s.left} className="animate-up">
          <div style={s.logo}>
            <div style={s.logoBox}>
              <svg width="24" height="24" viewBox="0 0 28 28" fill="none">
                <path d="M14 3L25 9V19L14 25L3 19V9L14 3Z" stroke="#38bdf8" strokeWidth="1.5" fill="rgba(56,189,248,0.1)"/>
                <path d="M14 10V18M10 14H18" stroke="#38bdf8" strokeWidth="2" strokeLinecap="round"/>
              </svg>
            </div>
            <span style={s.logoTxt}>Medi<span style={{color:'#38bdf8'}}>Explain</span> <span style={s.aiBadge}>AI</span></span>
          </div>

          <div style={{marginTop:56}}>
            <p style={s.tag}>Your health,</p>
            <p style={{...s.tag, fontStyle:'italic', color:'#38bdf8'}}>finally explained.</p>
          </div>
          <p style={s.tagSub}>Upload any medical report and get a clear, human explanation ‚Äî no medical degree required.</p>

          <div style={s.feats}>
            {[
              {i:'üìÑ', t:'Reads lab reports, prescriptions & clinical notes'},
              {i:'üß†', t:'AI-powered plain language explanations'},
              {i:'‚ö†Ô∏è', t:'Flags abnormal values with severity ratings'},
              {i:'üåê', t:'Supports English, Hindi, Bengali & more'},
            ].map((f,i)=>(
              <div key={i} style={s.feat} className={`animate-up delay-${i+1}`}>
                <span style={s.featI}>{f.i}</span>
                <span style={s.featT}>{f.t}</span>
              </div>
            ))}
          </div>

          <div style={s.disc}>‚öïÔ∏è Educational tool ‚Äî not a substitute for medical advice</div>
        </div>

        {/* ‚îÄ‚îÄ Right form panel ‚îÄ‚îÄ */}
        <div style={s.right}>
          <div style={s.card} className="glass-card animate-up">
            {/* Tabs */}
            <div style={s.tabs}>
              <button style={{...s.tab, ...(mode==='login'?s.tabOn:{})}} onClick={()=>{setMode('login');setError('');}}>Sign In</button>
              <button style={{...s.tab, ...(mode==='signup'?s.tabOn:{})}} onClick={()=>{setMode('signup');setError('');}}>Create Account</button>
            </div>

            <h2 style={s.ftitle}>{mode==='login'?'Welcome back':'Get started free'}</h2>
            <p style={s.fsub}>{mode==='login'?'Sign in to access your reports':'Create your free account'}</p>

            <form onSubmit={submit} style={{marginTop:28}}>
              {mode==='signup' && (
                <div style={s.fg} className="animate-up">
                  <label style={s.lbl}>Full Name</label>
                  <input name="name" type="text" value={form.name} onChange={set} placeholder="Your Name" className="input-field"/>
                </div>
              )}
              <div style={s.fg}>
                <label style={s.lbl}>Email Address</label>
                <input name="email" type="email" value={form.email} onChange={set} placeholder="you@example.com" className="input-field"/>
              </div>
              <div style={s.fg}>
                <label style={s.lbl}>Password</label>
                <div style={{position:'relative'}}>
                  <input name="password" type={showPw?'text':'password'} value={form.password} onChange={set} placeholder="‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢" style={{paddingRight:48}} className="input-field"/>
                  <button type="button" onClick={()=>setShowPw(!showPw)} style={s.eye}>{showPw?'üôà':'üëÅÔ∏è'}</button>
                </div>
              </div>

              {error && <div style={s.err}><span>‚ö†Ô∏è</span>{error}</div>}

              <button type="submit" disabled={loading} style={s.sbtn}>
                {loading
                  ? <span style={{display:'flex',alignItems:'center',justifyContent:'center',gap:10}}><span className="spinner"/>{mode==='login'?'Signing in...':'Creating account...'}</span>
                  : (mode==='login'?'Sign In ‚Üí':'Create Account ‚Üí')}
              </button>
            </form>

            {mode==='login' && <p style={s.forgot}><span style={{color:'#38bdf8',cursor:'pointer'}}>Forgot password?</span></p>}

            <div style={s.divRow}><div style={s.divLine}/><span style={s.divTxt}>or</span><div style={s.divLine}/></div>

            <button style={s.gbtn} onClick={demoLogin}>
              <svg width="18" height="18" viewBox="0 0 18 18">
                <path d="M17.64 9.2c0-.637-.057-1.251-.164-1.84H9v3.481h4.844c-.209 1.125-.843 2.078-1.796 2.716v2.259h2.908c1.702-1.567 2.684-3.875 2.684-6.615z" fill="#4285F4"/>
                <path d="M9 18c2.43 0 4.467-.806 5.956-2.18l-2.908-2.259c-.806.54-1.837.86-3.048.86-2.344 0-4.328-1.584-5.036-3.711H.957v2.332A8.997 8.997 0 0 0 9 18z" fill="#34A853"/>
                <path d="M3.964 10.71A5.41 5.41 0 0 1 3.682 9c0-.593.102-1.17.282-1.71V4.958H.957A8.996 8.996 0 0 0 0 9c0 1.452.348 2.827.957 4.042l3.007-2.332z" fill="#FBBC05"/>
                <path d="M9 3.58c1.321 0 2.508.454 3.44 1.345l2.582-2.58C13.463.891 11.426 0 9 0A8.997 8.997 0 0 0 .957 4.958L3.964 7.29C4.672 5.163 6.656 3.58 9 3.58z" fill="#EA4335"/>
              </svg>
              Continue with Google (Demo)
            </button>

            <p style={s.sw}>
              {mode==='login'?"Don't have an account? ":"Already have an account? "}
              <span style={{color:'#38bdf8',cursor:'pointer',fontWeight:600}} onClick={()=>{setMode(mode==='login'?'signup':'login');setError('');}}>
                {mode==='login'?'Sign up free':'Sign in'}
              </span>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

const s = {
  root:{ minHeight:'100vh',background:'#060d1a',display:'flex',alignItems:'center',justifyContent:'center',padding:'24px',position:'relative',overflow:'hidden' },
  grid:{ position:'absolute',inset:0,backgroundImage:'linear-gradient(rgba(56,189,248,0.04) 1px,transparent 1px),linear-gradient(90deg,rgba(56,189,248,0.04) 1px,transparent 1px)',backgroundSize:'60px 60px',pointerEvents:'none' },
  orb:{ position:'absolute',borderRadius:'50%',pointerEvents:'none' },
  wrap:{ display:'grid',gridTemplateColumns:'1fr 1fr',gap:'60px',maxWidth:'1000px',width:'100%',position:'relative',zIndex:1 },
  left:{ display:'flex',flexDirection:'column',justifyContent:'center' },
  logo:{ display:'flex',alignItems:'center',gap:'12px' },
  logoBox:{ width:48,height:48,background:'rgba(56,189,248,0.1)',border:'1px solid rgba(56,189,248,0.3)',borderRadius:'14px',display:'flex',alignItems:'center',justifyContent:'center' },
  logoTxt:{ fontFamily:'Fraunces,serif',fontSize:'22px',fontWeight:600,color:'#f0f6ff',letterSpacing:'-0.5px' },
  aiBadge:{ background:'linear-gradient(135deg,#0ea5e9,#2dd4bf)',color:'#fff',fontSize:'10px',fontWeight:700,padding:'2px 6px',borderRadius:'5px',marginLeft:'4px',verticalAlign:'middle',fontFamily:'DM Sans,sans-serif',letterSpacing:'1px' },
  tag:{ fontFamily:'Fraunces,serif',fontSize:'50px',fontWeight:600,lineHeight:1.1,color:'#f0f6ff',letterSpacing:'-1.5px' },
  tagSub:{ marginTop:20,fontSize:'16px',color:'#7a9cc4',lineHeight:1.7,maxWidth:380 },
  feats:{ marginTop:36,display:'flex',flexDirection:'column',gap:14 },
  feat:{ display:'flex',alignItems:'center',gap:12 },
  featI:{ fontSize:18,width:28,textAlign:'center' },
  featT:{ fontSize:'14px',color:'#a8c4e0' },
  disc:{ marginTop:40,fontSize:'12px',color:'#3d6090',padding:'10px 14px',background:'rgba(56,189,248,0.04)',border:'1px solid rgba(56,189,248,0.08)',borderRadius:'8px',maxWidth:380 },
  right:{ display:'flex',alignItems:'center',justifyContent:'center' },
  card:{ width:'100%',maxWidth:'420px',padding:'36px' },
  tabs:{ display:'flex',background:'rgba(0,0,0,0.3)',borderRadius:'10px',padding:'4px',marginBottom:28 },
  tab:{ flex:1,padding:'9px',background:'transparent',border:'none',borderRadius:'8px',color:'#7a9cc4',fontFamily:'DM Sans,sans-serif',fontSize:'14px',fontWeight:500,cursor:'pointer',transition:'all 0.2s' },
  tabOn:{ background:'rgba(56,189,248,0.15)',color:'#38bdf8',fontWeight:600 },
  ftitle:{ fontFamily:'Fraunces,serif',fontSize:'28px',fontWeight:600,color:'#f0f6ff',letterSpacing:'-0.5px' },
  fsub:{ marginTop:6,fontSize:'14px',color:'#7a9cc4' },
  fg:{ marginBottom:18 },
  lbl:{ display:'block',fontSize:'13px',fontWeight:500,color:'#a8c4e0',marginBottom:8,letterSpacing:'0.2px' },
  eye:{ position:'absolute',right:'14px',top:'50%',transform:'translateY(-50%)',background:'none',border:'none',cursor:'pointer',fontSize:'16px',padding:'4px' },
  err:{ background:'rgba(251,113,133,0.1)',border:'1px solid rgba(251,113,133,0.3)',borderRadius:'8px',padding:'10px 14px',color:'#fb7185',fontSize:'13px',marginBottom:16,display:'flex',gap:8,alignItems:'center' },
  sbtn:{ width:'100%',padding:'14px',background:'linear-gradient(135deg,#0ea5e9,#2dd4bf)',color:'#fff',border:'none',borderRadius:'12px',fontFamily:'DM Sans,sans-serif',fontSize:'15px',fontWeight:700,cursor:'pointer',transition:'all 0.2s',marginTop:4 },
  forgot:{ textAlign:'right',marginTop:10,fontSize:'13px' },
  divRow:{ display:'flex',alignItems:'center',gap:12,margin:'24px 0' },
  divLine:{ flex:1,height:'1px',background:'rgba(56,189,248,0.1)' },
  divTxt:{ fontSize:'12px',color:'#3d6090' },
  gbtn:{ width:'100%',display:'flex',alignItems:'center',justifyContent:'center',gap:10,background:'rgba(255,255,255,0.05)',border:'1px solid rgba(255,255,255,0.1)',borderRadius:'12px',padding:'12px',color:'#e8edf5',fontFamily:'DM Sans,sans-serif',fontSize:'14px',fontWeight:500,cursor:'pointer',transition:'all 0.2s' },
  sw:{ textAlign:'center',marginTop:20,fontSize:'14px',color:'#7a9cc4' },
};
